import React from "react";
import Button from "@mui/material/Button";

const Navbar = () => {
  return (
    <>
      <div className="nav_bar">
        <div className="home">Blogr</div>
        <ol>
          <li>Product</li>
          <li>Company</li>
          <li>Connect</li>
        </ol>
        <div className="signin_up">
          <button>Login</button>
          <button>Signup</button>
        </div>
      </div>
    </>
  );
};

export default Navbar;
